<!doctype html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>2</title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@400;500;700;900&family=Open+Sans:wght@700&display=swap" rel="stylesheet">
    <style>
        :root {
            font-size: 0.3125vw;
            /* 1px on iPhone 5 320x568 */
        }
        * {
            padding: 0;
            margin: 0;
            box-sizing: border-box;
            -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
        }

        html, body, .wrapper {
            height: 100%;
        }
        body {
            -webkit-text-size-adjust: 100%;
            height: 100%;
            background: #000000;
            font-family: 'Inter', sans-serif;
            /*font-family: 'Open Sans', sans-serif;*/
            display: flex;
            flex-direction: column;
            justify-content: space-between;
            align-items: center;
        }
        .top, .header, .main, .bottom {
            width: 100%;
        }
        .header {
            padding-top: 14rem;
            padding-bottom: 13rem;
        }
        /*.header > */
        .container {
            /*max-width: 357px;*/
            margin: 0 auto;
        }
        .header-top {
            display: flex;
            justify-content: space-between;
            align-items: center;
        }
        .logo {
            /*max-width: 133px;*/
            width: 135rem;
            margin-left: 14rem;
        }
        .age {
            /*max-width: 39px;*/
            width: 35rem;
        }
        .logo > img, .age > img, .banner > img {
            width: 100%;
        }
        .header-title {
            margin-top: 10rem;
            width: 100%;
            text-align: center;
            font-family: 'Inter', sans-serif;
            font-style: normal;
            font-weight: 700;
            font-size: 19.6rem;
            color: #FFFFFF;
        }
        .main {
            border-top: 1px solid #323232;
            border-bottom: 1px solid #323232;
            /*padding-bottom: 5rem;*/
            padding-bottom: -5px;
        }
        .main > .container {
            max-width: 600px;
        }
        .banner {
            margin: 0 auto;
            padding: 0 4rem;
        }
        .button {
            margin-top: 13.7rem;
            margin-bottom: 10rem;
        }

        .btn {
            display: flex;
            align-items: center;
            justify-content: center;
            max-width: 284px;
            width: 85%;
            max-height: 67px;
            height: 70rem;
            margin: 0 auto;
            background: #8F00FF;
            border-radius: 6px;
            -webkit-box-shadow: 0px 5px 0px 0px #5A019F;
            -moz-box-shadow: 0px 5px 0px 0px #5A019F;
            box-shadow: 0px 5px 0px 0px #5A019F;
        }
        .btn > span {
            font-family: 'Open Sans', sans-serif;
            font-style: normal;
            font-weight: 700;
            font-size: 24rem;
            text-align: center;
            color: #FFFFFF;
        }
        .btn > img {
            max-width: 42px;
            width: 40rem;
            margin-left: 10.25rem;
        }
        .price {
            margin-top: 11rem;
            font-style: normal;
            font-weight: 500;
            font-size: 12rem;
            text-align: center;
            color: #FFFFFF;
        }
        .bottom {
            border-top: 1px solid #323232;
            padding-bottom: 10rem;
            padding-top: 10rem;
        }
        .footer {
            font-style: normal;
            font-weight: 400;
            font-size: 10rem;
            text-align: center;
            color: #D6D6D6;
        }
        .footer > a {
            text-decoration: underline;
            color: inherit;
        }


        @media (min-width: 375px) {
            .btn > span {
                font-size: 28.125px;
            }
            .price {
                font-size: 14.062px;
            }
            .footer {
                font-size: 12px;
            }
        }
        @media (max-height: 605px) and (orientation: landscape) {
            .header {
                padding-top: 4rem;
                padding-bottom: 4rem;
            }
            .header-title {
                font-size: 24px;
            }
            .banner {
                max-width: 20vh;
            }
        }
        @media (max-height: 605px) and (orientation: landscape) {
            .main {
                display: none;
            }
            .button {
                position: absolute;
                width: 100%;
                top: 50%;
                left: 50%;
                transform: translate(-50%, -50%);

            }
            .bottom {
                border-top: 1px solid #323232;
                padding-bottom: 3rem;
            }
        }
        @media (max-height: 568px) and (max-width: 320px) {
            .banner {
                max-width: 75%;
            }
        }
        @media (min-width: 550px) {
            :root {
                font-size: 1.71875px;
            }
        }
        @media (orientation: landscape) and (max-height: 550px) {
            :root {
                font-size: 0.3125vh;
            }
        }

    </style>
</head>
